Debo mencionar que este soneto fue escrito como un homenaje póstumo a otro autor, y que la atribución podría tener cierto margen de error, ya que algunos poemas de esta época pueden tener autorías disputadas o inciertas. José de Cañizares fue un dramaturgo y poeta español que vivió entre 1676 y 1750.
